import { SET_CURRENT_ROUTE } from './actions';

const initialState = {
  currentRoute: '/',
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case SET_CURRENT_ROUTE:
      return {
        ...state,
        currentRoute: action.payload,
      };
    default:
      return state;
  }
};

export default reducer;
